    super(props);
    console.log("constructor");
    console.log(this.props.user);
    this.state = {
      user: this.props.user,
      userData: this.props.userData
    };
  }
  render() {
    console.log(this.props.user);
    console.log(this.state);
    return (
      <>
        <MainLayout>
          <h1>Welcome to NextJS</h1>
        </MainLayout>
      </>
    );
  }
}
